import React, { useState } from 'react';
import { Menu, Button } from 'antd';
import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;

const Navbar = () => {
  const [collapsed, setCollapsed] = useState(false)

  const toggleCollapsed = () => { 
    setCollapsed(!collapsed)
  }

  return (
    <Menu
      mode="inline"
      theme="light"
      inlineCollapsed={collapsed}>
        <Menu.Item key="1" icon={<AppstoreOutlined/>}>
          Dashboard
        </Menu.Item>
        <Menu.Item key="2">
          Windy
        </Menu.Item>
        <Menu.Item key="3">
          Webcams
        </Menu.Item>
      </Menu>
  );
};
export default Navbar;
